import React, { Component } from 'react';
import {Element} from 'react-scroll';
import {Image} from './front_page_backgrnd.png';
class About extends Component {

  render() {
    return (
    	<React.Fragment>
    	// <Element id='about' name='about' style={{position:'fixed',top:100,color:'white'}}>
    	// 	Hello
    	// </Element>
    	

    	<img src={Image} style={{position:'fixed',top:1000}}/>
    	</React.Fragment >
    );
  }
}

export default About;
